import UIKit

class StackedDrawables: UIView {
    private var layers: [CALayer]
    private var iconScale: CGFloat = 0.70
    private var shouldPlaceIcons = true

    init(layers: [CALayer], iconScale: CGFloat = 0.70) {
        self.layers = layers
        self.iconScale = iconScale
        super.init(frame: .zero)
        setupLayers()
    }

    required init?(coder: NSCoder) {
        fatalError("init(coder:) has not been implemented")
    }

    private func setupLayers() {
        for layer in layers {
            self.layer.addSublayer(layer)
        }
    }

    override func layoutSubviews() {
        super.layoutSubviews()
        if shouldPlaceIcons {
            placeIcons()
        } else {
            shouldPlaceIcons = true
        }
    }

    private func placeIcons() {
        shouldPlaceIcons = false
        let newWidth = bounds.width
        let iconsSize = floor(newWidth * iconScale)
        let iconsInset = (newWidth - iconsSize) - 1

        for (index, layer) in layers.enumerated() {
            layer.bounds = CGRect(x: 0, y: 0, width: iconsSize, height: iconsSize)
            layer.position = CGPoint(x: bounds.midX, y: bounds.midY)
            switch index {
            case 1:
                layer.frame.origin.x = 0
                layer.frame.origin.y = iconsInset
            case 0:
                layer.frame.origin.x = iconsInset
                layer.frame.origin.y = 0
            default:
                break
            }
        }
    }
}
```

