To create a tooltip in Next.js using React Context to close previously opened tooltips, you can follow these steps:

1. Create a Tooltip context using `React.createContext()`.
2. Create a TooltipProvider component that wraps your application and provides the context to its children.
3. Inside the TooltipProvider component, create a state variable to keep track of the currently open tooltip.
4. Create a function to close the currently open tooltip and update the state variable.
5. Pass the state variable and the close function as values to the Tooltip context.
6. Create a Tooltip component that uses the Tooltip context to access the close function and the currently open tooltip.
7. Inside the Tooltip component, use the `useEffect` hook to call the close function when the component unmounts.
8. Use the Tooltip component in your application and pass the tooltip content as a prop.

Here's an example implementation:

```jsx
import React, { createContext, useState, useContext, useEffect } from 'react';

// Create the Tooltip context
const TooltipContext = createContext();

// Create the TooltipProvider component
export const TooltipProvider = ({ children }) => {
  // Create a state variable to keep track of the currently open tooltip
  const [openTooltip, setOpenTooltip] = useState(null);

  // Create a function to close the currently open tooltip
  const closeTooltip = () => {
    setOpenTooltip(null);
  };

  // Pass the state variable and the close function as values to the Tooltip context
  return (
    <TooltipContext.Provider value={{ openTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

// Create the Tooltip component
export const Tooltip = ({ children }) => {
  // Use the Tooltip context to access the close function and the currently open tooltip
  const { openTooltip, closeTooltip } = useContext(TooltipContext);

  // Use the useEffect hook to call the close function when the component unmounts
  useEffect(() => {
    return () => {
      if (openTooltip === children) {
        closeTooltip();
      }
    };
  }, [openTooltip, children, closeTooltip]);

  // Render the tooltip content
  return (
    <div>
      {/* Add your tooltip content here */}
      {children}
    </div>
  );
};
```

To use the Tooltip component in your application, wrap your application with the TooltipProvider component and use the Tooltip component wherever you want to display a tooltip.

```jsx
import { TooltipProvider, Tooltip } from './TooltipContext';

function App() {
  return (
    <TooltipProvider>
      <div>
        <Tooltip>Tooltip 1</Tooltip>
        <Tooltip>Tooltip 2</Tooltip>
        <Tooltip>Tooltip 3</Tooltip>
      </div>
    </TooltipProvider>
  );
}

export default App;
```

In this example, when a Tooltip component unmounts, it will call the `closeTooltip` function to close the currently open tooltip. This ensures that only one tooltip is open at a time.
